import React from 'react';
import './App.css';

function App() {
  const message = "Hello from BridgeLabz";
  const logoUrl = "https://via.placeholder.com/150x50.png?text=BridgeLabz+Logo";

  return (
    <div className="App">
      <header className="App-header">
        <h1>{message}</h1>
      </header>
    </div>
  );
}

export default App;
